import axios from "axios";
import {useState} from "react";

export function Rooms({username}) {
    const [selectedRoom, setSelectedRoom] = useState("Main room");
    async function getRooms() {
        return await axios.post("/getrooms", {username: username})
    }

    return (
        <div className="chatRooms">
            {getRooms.map(function(room, index) {
                return (
                    <div key={room._id}>
                        {room.name}
                    </div>
                )

            })}
        </div>
    )
}
